import React, {useRef, useState} from 'react'
import Footer from '../components/Footer'
import Header from '../components/Header'
import PageTitle from '../components/PageTitle'
import axios from "axios";
import cookie from 'react-cookies';
import { Container, Row, Col } from 'reactstrap'
import Breakfast from '../images/Breakfast.svg'
import Lunch from '../images/Lunch.svg'
import Dinner from '../images/Dinner.svg'
import Appetizers from '../images/Appetizers.svg'
import Desert from '../images/Desert.svg'
import Drinks from '../images/Drinks.svg'
import { Modal, Button } from 'react-bootstrap';
import "../styles/home.css"

const Home = () => {
  const sectionRef = useRef();

  const [section, setSection] = useState('ALL');
  const [show, setShow] = useState(false);
  const [sectionName, setSectionName] = useState('');

  const addSection = async (e) => {
    //e.preventDefault();
    setShow(true);
    //let userid = cookie.load('cookie2');
    //console.log("User id is " + userid);
    let sectionName = sectionName;
    console.log("IN Add  section.......section name...ui  " + sectionName);
    let addedData = {
      "sectionName": sectionName,
      "restaurantID": 51
    }

    axios.defaults.withCredentials = true;
    try {
      const response = await axios.post("http://localhost:8080/api/users/sections/addSection", addedData , {
          headers: {
              'Content-Type': 'application/json',
              'Access-Control-Allow-Origin': 'http://localhost:3000',
          }
      }).then(async (response) => {
          console.log(response.data);
      })
    } catch (err) {
      console.log("Error on adding Section")
    }
  }
  const handleClose = () => {
    setShow(false)
  }

  return (
    <PageTitle title="Home">
          <Header />

          <section>
            <Container>
              <Row>
                <Col lg='12' className='text-center'>
                  <h2>Popular Foods</h2>
                </Col>

                <Col lg='12'>
                  <div className='food__category d-flex align-items-center justify-content-center gap-4'>
                    <button className={`all__btn ${section === 'ALL' ? 'foodBtnActive' : ''}`}
                      onClick={()=>setSection('ALL')}>All</button>

                  <button className={`d-flex align-items-center gap-2 ${section === 'Breakfast' ? 'foodBtnActive' : ''}`} 
                    onClick={()=>setSection('Breakfast')}>
                    <img src={Breakfast} alt=''/>Breakfast</button>

                  <button className={`d-flex align-items-center gap-2 ${section === 'Lunch' ? 'foodBtnActive' : ''}`}
                   onClick={()=>setSection('Lunch')}>
                    <img src={Lunch} alt=''/>Lunch</button>

                  <button className={`d-flex align-items-center gap-2 ${section === 'Dinner' ? 'foodBtnActive' : ''}`}
                   onClick={()=>setSection('Dinner')}>
                    <img src={Dinner} alt=''/>Dinner</button>

                    <button className={`d-flex align-items-center gap-2 ${section === 'Appetizers' ? 'foodBtnActive' : ''}`}
                   onClick={()=>setSection('Appetizers')}>
                    <img src={Appetizers} alt=''/>Appetizers</button>

                    <button className={`d-flex align-items-center gap-2 ${section === 'Desert' ? 'foodBtnActive' : ''}`}
                   onClick={()=>setSection('Desert')}>
                    <img src={Desert} alt=''/>Desert</button>

                    <button className={`d-flex align-items-center gap-2 ${section === 'Drinks' ? 'foodBtnActive' : ''}`}
                   onClick={()=>setSection('Drinks')}>
                    <img src={Drinks} alt=''/>Drinks</button>

                    <button className='add__section d-flex align-items-center gap-2' 
                    onClick={addSection}>Add Section</button>
                  </div>
                </Col>
              </Row>
              <Modal className="setModal143" show={show} onHide={handleClose} centered={show}>
                <Modal.Header className="item2">
                  <Modal.Title >Add Section</Modal.Title>
                </Modal.Header>
                <Modal.Body className="item3">
                  <div className="form-group">
                    Section Name <input type="text" id="sectionName" ref={sectionRef} autoComplete="off" className="form-control" 
                    onChange={(e) => setSectionName(e.target.value)} value={sectionName} required />
                  </div>
                </Modal.Body>
                <Modal.Footer className="item2">
                  <Button variant="primary" className="s-btn s-btn-primary u-block-xs--down s-col-sm-5 s-col-xs-12">
                    <span className="s-btn-copy" onClick={addSection}>Save</span>
                  </Button>
                  <Button variant="secondary" onClick={handleClose} className="s-btn s-btn-primary u-block-xs--down s-col-sm-5 s-col-xs-12">
                    <span className="s-btn-copy">Close</span>
                  </Button>
                </Modal.Footer>
              </Modal>
            </Container>
          </section>

          <Footer />
    </PageTitle>
  )
}

export default Home
